INSERT INTO proposicao VALUES ("2311331",	"Proposta de Fiscalização e Controle",	"Propõe que à Comissão de Fiscalização Financeira e Controle realize, com auxílio do Tribunal de Contas da União (TCU), realize ato de fiscalização e controle para apurar eventuais irregularidades ocorridas nas compras, entregas e armazenamento dos medicamentos utilizados no tratamento do Diabetes Mellitus.",	"2021-12-07T18:23:00");
INSERT INTO proposicao VALUES ("2311467",	"Proposta de Fiscalização e Controle",	"Propõe que a Comissão de Fiscalização Financeira e Controle, com o auxílio do Tribunal de Contas da União, proceda ato de fiscalização e controle junto ao Conselho Administrativo de Defesa Econômica.",	"2021-12-08T11:39:00");
INSERT INTO proposicao VALUES ("2311740",	"Proposta de Fiscalização e Controle",	"Requer que a Comissão de Fiscalização Financeira e Controle realize, com o auxílio do Tribunal de Contas da União (TCU) e outros órgãos, procedimento fiscalizatório específico junto à Caixa Econômica Federal para apurar eventuais irregularidades no uso indiscriminado da estrutura do banco público e de seus recursos para favorecimento pessoal, em campanha política antecipada do seu dirigente e do presidente da República a partir da criação da gerência Caixa Mais Brasil; a prática de advocacia administrativa no âmbito da instituição; o direcionamento de recursos destinados a ações de publicidade, patrocínio e comunicação do banco, além da ausência de mecanismos de transparência sobre tais gastos; e ainda, a apuração sobre o lucro líquido da instituição, considerando as falsas alegações do atual gestor sobre supostos prejuízos e déficits da ordem de R$ 46 bilhões que teriam sido identificados na Caixa nas gestões anteriores ao ano de 2019, com ênfase ao período compreendido entre 2003 a 2010.",	"2021-12-13T15:39:00");
INSERT INTO proposicao VALUES ("2312047",	"Proposta de Fiscalização e Controle",	"Propõe que a Comissão de Fiscalização  Financeira e Controle, com o auxílio do  Tribunal de Contas da União, realize ato de  fiscalização e controle a fim de quantificar e  avaliar a economicidade dos gastos realizados  pelo Supremo Tribunal Federal no âmbito dos  inquéritos 4828/DF e 4781/DF.",	"2021-12-08T20:24:00");
INSERT INTO proposicao VALUES ("2312667",	"Requerimento de Inclusão de Matéria para Apreciação Imediata na Comissão",	"Requer a inclusão do PL 1361/2015 na Ordem do Dia da Comissão de Constituição, Justiça e Cidadania (CCJC).",	"2021-12-15T16:47:00");
INSERT INTO proposicao VALUES ("2313767",	"Subemenda de Relator",	"Assim, votamos pela constitucionalidade, juridicidade e boa técnica legislativa do PL nº 5.717/16 e do PL nº 8.988/17 (apensado); pela constitucionalidade, juridicidade e boa técnica legislativa do substitutivo/CTASP, com a redação dada pela subemenda em anexo; e finalmente pela constitucionalidade, juridicidade e boa técnica legislativa da subemenda/CVT ao substitutivo/CTASP.",	"2022-01-10T20:34:00");
INSERT INTO proposicao VALUES ("2313775",	"Mensagem de Acordos, convênios, tratados e atos internacionais",	"Submete à elevada consideração  dos Senhores Membros do Congresso Nacional, nos termos do disposto no art. 49, inciso I, combinado com o art. 84, inciso VIII, da Constituição, acompanhado de Exposição de Motivos do Senhor Ministro de Estado das Relações Exteriores, o texto do Acordo sobre a Mobilidade entre os Estados-Membros da Comunidade dos Países de Língua Portuguesa (CPLP), assinado em Luanda, em 17 de julho de 2021.",	"2022-01-14T15:54:00");
INSERT INTO proposicao VALUES ("2313776",	"Medida Provisória",	"Abre crédito extraordinário, em favor do Ministério do Desenvolvimento Regional, no valor de R$ 550.000.000,00, para o fim que especifica  NOVA EMENTA: Abre crédito extraordinário em favor do Ministério do Desenvolvimento Regional, no valor de R$ 550.000.000,00 (quinhentos e cinquenta milhões de reais), para o fim que especifica",	"2022-01-21T09:23:00");
