INSERT INTO proposicao VALUES ("2313779",	"Mensagem de Acordos, convênios, tratados e atos internacionais",	"Submete à consideração  dos membros do Congresso Nacional,  nos termos do disposto no art. 49, inciso I, combinado com o art. 84, inciso VIII, da Constituição, acompanhado de Exposição de Motivos dos Senhores Ministros de Estado das Relações Exteriores e da Justiça e Segurança Pública, o texto do Acordo  entre a República Federativa do Brasil e a República da Índia sobre Assistência Jurídica Mútua em Matéria Penal, assinado em Nova Délhi, em 25 de janeiro de 2020.",	"2022-01-27T17:03:00");
